import logo from './logo.svg';
import './App.css';
import Home from './root-folder/pages/Home';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <>
      <BrowserRouter>
        <Switch>
          <Route path="/" component={MyComponent} />
        </Switch>
      </BrowserRouter>
      <Home />
    </>
  );
}

export default App;
